import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <div className="header">
      <div className="header-link">
        <Link to="/users">회원 목록</Link>  |   
        <Link to="/signup">회원 가입</Link> {/* 회원가입 링크 추가 */}
      </div>
    </div>
  );
}

export default Header;
